import React from 'react';
import './App.css';
import Countdown from './components/Countdown';

function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>
      {events.map(event =>
        <Countdown
          id={event.id}
          title={event.title}
          month={event.month}
          day={event.day}
          year={event.year}
        />
      )}
      <Countdown />
    </div>
  );
}

export default App;
